import React from 'react';
import s from './Dialogs.module.css';
const Dialogs = (props) => {
    return (<header className={s.header}>
        <img src='https://i.pinimg.com/236x/a7/5c/0d/a75c0da86ac499bc5fb95d2856b2da3c--hot-dudes-som.jpg?nii=t' />
    </header>
    )
}
export default Dialogs;
